import React from "react";
import {useNavigate} from 'react-router-dom'
const Home = () => {
    const navigate = useNavigate();
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "90vh",
      }}
    >
      <button style={{marginRight:"20px"}} onClick={()=>{
        navigate("/login")
      }}>Login</button>
      <button onClick={()=>{
        navigate("/signup")
      }}>Signup</button>
    </div>
  );
};

export default Home;
